import {NavLink} from 'react-router-dom';

const Error = () => {
  return (
    <>

    <div>
     <h1> 404 Error </h1>
     <p>Sorry Page was not Found</p>
     <Navlink exact activeClassName = 'active_class' className='navlink' to="/">Home</Navlink>
     </div>

    </>
  );
}

export default Error;
